namespace MergeSort
{
    public class AgreeYaTestService2 : IBaseService
    {
        public void ConsoleRun()
        {

        }

        public int[] MyMethodStack(int[] cities)
        {
            var capitalIndex = -1;
            var distances = new int[cities.Length - 1];
            var hash = new HashSet<int>[cities.Length];
            
            for (int i = 0; i < cities.Length; i++)
            {
                if (hash[cities[i]] == null)
                    hash[cities[i]] = new HashSet<int>();
                if (cities[i] == i)
                    capitalIndex = i;
                else
                    hash[cities[i]].Add(i);
            }

            var stack = new Stack<Tuple<int, int>>();  //cityIndex, distanceIndexFromCapital
            var distanceIndexFromCapital = 0;
            
            foreach (var childCity in hash[capitalIndex])
            {
                stack.Push(new Tuple<int, int>(childCity, distanceIndexFromCapital));
            }

            while (stack.Count > 0)
            {
                var childToProcess = stack.Pop();
                distances[childToProcess.Item2]++;

                if (hash[childToProcess.Item1] == null)
                {
                    continue;
                }

                foreach (var childCity in hash[childToProcess.Item1])
                {
                    stack.Push(new Tuple<int, int>(childCity, childToProcess.Item2 + 1));
                }
            }

            return distances;
        }

    }

